import React from "react";
import styled from "styled-components";
import FrontData from "./FrontPage";

function ModelS() {
  return (
    <Container>
      <FrontData
        title="Model S"
        description="Plaid"
        backgroundImg="/images/model-s.jpg"
        BtnText="Order Now"
      />
    </Container>
  );
}

const Container = styled.div`
  height: 100vh;
`;
export default ModelS;
